package org.apache.nutch.entitybean;

public class CinemaBean {
	private String cinemaId;
	private String cinemaName;
	private String cinemaDes;
	private String cinemaUrl;
	private String cinemaExtraUrl;
	private String languageCode;

	public CinemaBean() {
		// TODO Auto-generated constructor stub
	}

	public String getCinemaId() {
		return cinemaId;
	}

	public void setCinemaId(String cinemaId) {
		this.cinemaId = cinemaId;
	}

	public String getCinemaName() {
		return cinemaName;
	}

	public void setCinemaName(String cinemaName) {
		this.cinemaName = cinemaName;
	}

	public String getCinemaDes() {
		return cinemaDes;
	}

	public void setCinemaDes(String cinemaDes) {
		this.cinemaDes = cinemaDes;
	}

	public String getCinemaUrl() {
		return cinemaUrl;
	}

	public void setCinemaUrl(String cinemaUrl) {
		this.cinemaUrl = cinemaUrl;
	}

	public String getCinemaExtraUrl() {
		return cinemaExtraUrl;
	}

	public void setCinemaExtraUrl(String cinemaExtraUrl) {
		this.cinemaExtraUrl = cinemaExtraUrl;
	}

	public String getLanguageCode() {
		return languageCode;
	}

	public void setLanguageCode(String languageCode) {
		this.languageCode = languageCode;
	}

}
